@hookedtournament was amazing! So blessed to be back as a special guest again this year and got to host my biggest webster seminar to date! So many things to unpack from this event, mentally and actually. Massive shoutout to Hooked Staff and sponsors for making this event an amazing one! I’ll be promoting HOOKED all year so that 2024 is the US TAKEOVER! I’m overjoyed to have experience this glorious event and to have shared so many laughs with everyone! 💛💙❤️ I’m so in love with Tricking and it’s beautiful to share this same adoration towards this art at such a special place in the world. Happy Hooked Everyone! Until next year 😄 

